import React, { useState } from 'react';
import './SequencingNav.css';

interface NavItem {
  id: string;
  label: string;
  icon: React.ReactNode;
  hasChevron?: boolean;
  isDropdown?: boolean;
  subItems?: NavItem[];
}

interface NavCategory {
  title: string;
  items: NavItem[];
}

const SequencingNav: React.FC = () => {
  const [isNooksDropdownOpen, setIsNooksDropdownOpen] = useState(false);
  const [expandedSections, setExpandedSections] = useState<Set<string>>(new Set(['sequencing']));

  const toggleSection = (sectionId: string) => {
    const newExpanded = new Set(expandedSections);
    if (newExpanded.has(sectionId)) {
      newExpanded.delete(sectionId);
    } else {
      newExpanded.add(sectionId);
    }
    setExpandedSections(newExpanded);
  };

  const navigationData: NavCategory[] = [
    {
      title: 'Engage',
      items: [
        {
          id: 'call',
          label: 'Call',
          icon: (
            <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M3 5C3 3.89543 3.89543 3 5 3H8.27924C8.70967 3 9.09181 3.27543 9.22792 3.68377L10.7257 8.17721C10.8831 8.64932 10.6694 9.16531 10.2243 9.38787L7.96701 10.5165C9.06925 12.9612 11.0388 14.9308 13.4835 16.033L14.6121 13.7757C14.8347 13.3306 15.3507 13.1169 15.8228 13.2743L20.3162 14.7721C20.7246 14.9082 21 15.2903 21 15.7208V19C21 20.1046 20.1046 21 19 21H18C9.71573 21 3 14.2843 3 6V5Z" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
          ),
          hasChevron: true,
          isDropdown: true,
          subItems: []
        },
        {
          id: 'coach',
          label: 'Coach',
          icon: (
